import './css/Note.css';
import delIcon from './assets/delete.png';

function Note({id, text, date}) {
    return (
        <div className='note-body'>
            {text} 
            <div className='note-footer'> 
                {date}

                <button className="dropbtn"> More </button>
                <div class="dropup-content">
                    <a href="#">Background</a>
                    <a href="#">Update</a>
                    <a href="#">Delete</a>
                </div>              
            </div>           
        </div>
    );
}

export default Note;
